        label: 'Litecoin (LTC or Ł) is a peer-to-peer cryptocurrency and open-source software project released under the MIT/X11 license. Litecoin was an early bitcoin spinoff or altcoin, starting in October 2011. In technical details, Litecoin is nearly identical to Bitcoin.',
        ref: 'wikipedia',
        url: 'https://en.wikipedia.org/wiki/Litecoin',
